import './App.css';
import Footer from './components/Footer'
import {Container , Rows , Cols} from 'react-bootstrap'
import Header from './components/Header'
import HomeScreen from './screens/HomeScreen';
function App() {
  return (
    <>
      <Header />
      <Container>
      <main>
        <Container>
          <HomeScreen />
        </Container>
      </main>
      </Container>
      <Footer />
    </>
  );
}

export default App;
